Crashes that Changed Flying

Technology Documentary hosted by Kerry Shale, published by Discovery Channel in 2009 - English narration


Information
------------------------------

'Crashes That Changed Flying' takes viewers through some of the world's worst air accidents and the measures taken to make flying one of the safest forms of travel. Ripped fuselages, exploding fuel tanks, runway overruns, and more have inspired the technological breakthroughs that will help keep your next flight safe. From the crash of Delta flight 191, which has led to the development of an onboard warning system, to the Concorde crash in Paris which inspired the design of burst-proof tyres. Witness the unforgettable tragedies that helped engineers and scientists to come up with solutions to ensure that such accidents would not be repeated.

Produced by Wall to Wall Media LTD for DISCOVERY CHANNEL

